Not Easily Broken (2009)  

Verenigde Staten
Drama

geregisseerd door Bill Duke
met Morris Chestnut, Taraji P. Henson en Maeve Quinlan

Het verhaal volgt een gelukkig getrouwd stel, Clarice (Henson) en Dave (Chestnut). Hun trouw en eer aan elkaar wordt echter getest nadat Clarice zwaar gewond raakt bij een auto ongeluk, en Dave een affaire begint met een ander vrouw.


